class MakeLike{constructor(e){this.toggler=e,this.toggleLike()}toggleLike(){$(this.toggler).click((function(e){e.preventDefault(),console.log("likes called"),$(this).prop("href"),$.ajax({type:"get",url:$(this).prop("href"),success:function(e){if("Post"==e.data.type){let t=e.data.deleted,l=e.data.likeable_id,i=parseInt($(`#likes-container-${l}`).html());t?i>0&&i--:i++,$(`#likes-container-${l}`).html(`${i}`)}else{let t=e.data.deleted,l=e.data.likeable_id,i=parseInt($(`#likes-container-${l}`).html());t?i>0&&i--:i++,$(`#likes-container-${l}`).html(`${i}`)}}})}))}}